import React, { useState, useEffect } from 'react';

function App() {
    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch("/members")
            .then(res => res.json())
            .then(data => {
                setData(data);
                console.log(data);
            });
    }, []);

    return ( <
        div > {
            typeof data.mem === 'undefined' ? ( <
                p > Loading....... < /p>
            ) : (
                data.mem.map((mem, i) => ( <
                    p key = { i } > { mem } < /p> 
                ))
            )
        } <
        /div>
    );
}

export default App;
